import React, { Component } from 'react';
import { Link } from 'react-router-dom';


class Menu extends Component{
	render(){

        let { lang , children} = this.props;

		return (
            <>
                <nav className="navbar navbar-expand-lg navbar-light bg-light">
                    <div className="collapse navbar-collapse" id="navbarNavDropdown">
                        <ul className="navbar-nav">
                            <li className="nav-item "><Link className="nav-link" to={`${lang}`}>Home</Link></li>
                            <li className="nav-item "><Link className="nav-link" to={`${lang}/about`}>About</Link></li>
                            <li className="nav-item "><Link className="nav-link" to={`${lang}/topics`}>Topics</Link></li>
                            <li className="nav-item "><Link className="nav-link" to={`${lang}/contacts`}>Contacts</Link></li>
                        </ul>
                    </div>
                </nav>
                {children}

                <footer class="page-footer font-small blue">
                <div class="footer-copyright text-center py-3">© 2020 Copyright:
                    <a href="/"> MDBootstrap.com</a>
                </div>
                </footer>
            </>
		);
	}
}	

export default Menu;
